Share & Save. Are we shade twin ? Sharing foundation shade matches for MAC Studio Fix Foundation NC40. This video has a mix of foundation plus few skin tint matches. 

Foundations in frame: 
@maccosmeticsindia Studio Fix Foundation NC40 
@toofacedlovesindia Born This Way Foundation Warm Beige 
@esteelauderin Double Wear Foundation Cashew 
@nudestix Tinted Cover Foundation Nude 4 
@lancomeofficial Teint Idole 050 Beige Ambré (Looks little light but settles well on my skin tone post little bit of oxidation) 
@kirobeauty Daily Dewy Serum Foundation Almond Beige (I can go a shade up in this but the shade sun beige looks very light, so either it will be a mix of two shades for me, will update it here once I try that shade) 
nykaabeauty Matte To Last 08Y Medium 
@nyxcosmetics_in Bare With Me Skin Tint Foundation 10 Medium 
@fentybeauty Eaze Drop Blurring Skin Tint (One year old shade & I can go one shade up in this now & that would be Shade 12) 
@smashboxindia Halo Tinted Moisturiser Medium (It makes me look little dull after a while & light medium looks little light at first but settles well post oxidisation) 
@maybelline_ind Fit Me Fresh Skin Tint 09 
@blueheavencosmetics Hydrating Skin Tint Honey Tan 
@lamel.india Skin Tint 405 Latte 
@kaybykatrina Hydrating Foundation 145 N Medium
@lorealindia Infallible Fresh Wear Foundation 260 
@maybelline_ind Fit Me Foundation 228 Soft Tan 

Other brand foundations shade matches for my skin tone that I don’t own atm are: 
Makeup forever HD Skin 425 (skin like) 365 (one shade lighter) settles good on me
Dior backstage 3W & 3WO 
Clinique serum foundation W 76 toasted wheat M
CT Beautiful skin foundation 8 warm 
Anastasia Beverly Hills Luminous Foundation 330W
Rare Beauty Foundation 280 N
Milani 2 in 1 foundation 06 Sand Beige(little light but manageable, because 07 is too dark)
Maybelline lumi mattte Foundation 228 

